@seanjohnson405 @cishetcoded Preach! He's anything but terribly written.

Poor dude has been through so much and realistically so gone nuts over it. That scene where he finally got to let his trauma out to Echidna and her alone, is still such a fantastic scene.

I can't wait to see him grow further next arc!

